// roles.js
import React, { useEffect, useState } from 'react';
import transactionService from '../../services/transactionService';
import { useUser } from '../../context/userProvider';

import { Link, useNavigate } from 'react-router-dom';
import roleService from '../../services/roleService';

const RoleManager = () => {
    const navigate = useNavigate();

    const [page, setPage] = useState(1);
    const { user } = useUser();
    const [roles, setRoles] = useState();
    useEffect(() => {
        const fetchData = async () => {
            try {
                const data = await roleService.getAllByPage({ page: page, size: 5 });
                console.log(data);
                setRoles(data);
            } catch (error) {
                console.error('Error fetching products:', error);
            }
        };

        fetchData();
    }, [page]);


    const handleClick = (role) => {
        navigate('/dashboard/role-details', { state: { role } });
    }
    return (
        <div class="container">
            <div className='bg-gray-500'>
                {/* header */}
                <div className='flex justify-between mb-4'>
                    <input type="text" className='rouded rounded-md p-1' placeholder='Search' ><svg aria-hidden="true" class="w-5 h-5 text-gray-500 dark:text-gray-400" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg">
                                            <path fill-rule="evenodd" clip-rule="evenodd" d="M8 4a4 4 0 100 8 4 4 0 000-8zM2 8a6 6 0 1110.89 3.476l4.817 4.817a1 1 0 01-1.414 1.414l-4.816-4.816A6 6 0 012 8z"></path>
                                        </svg></input>
                    <button className='bg-orange-500 rounded rounded-md p-1 text-white'> Add product</button>
                    <button className='bg-white flex items-center p-1 rounded rounded-md'>
                        <svg xmlns="http://www.w3.org/2000/svg" aria-hidden="true" class="h-4 w-4 mr-1.5 -ml-1 text-gray-400" viewBox="0 0 20 20" fill="currentColor">
                            <path fill-rule="evenodd" d="M3 3a1 1 0 011-1h12a1 1 0 011 1v3a1 1 0 01-.293.707L12 11.414V15a1 1 0 01-.293.707l-2 2A1 1 0 018 17v-5.586L3.293 6.707A1 1 0 013 6V3z" clip-rule="evenodd"></path>
                        </svg> fillter options
                    </button>
                </div>
                {/* body */}
                <div className=''>
                    <table className='w-full'>
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>Type</th>
                                <th>Category</th>
                                <th>Quantity</th>
                                <th>Daily Sales</th>
                                <th>Monthly Sales</th>
                                <th>Rating</th>
                                <th>Total Sales</th>
                                <th>Total Revenue</th>
                                <th>Updated Date</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Product </td>
                                <td>Type</td>
                                <td>Category</td>
                                <td>popup</td>
                                <td>1000</td>
                                <td>10000</td>
                                <td>5</td>
                                <td>5000</td>
                                <td>50000</td>
                                <td>2023-11-30</td>

                            </tr>
                            
                        </tbody>
                    </table>
                </div>
            </div>
        </div>

    );
};

export default RoleManager;
